import React from 'react';
import Sidebar from '../components/sidebar';
import StatCard from '../components/statcard';
import ServicesTable from '../components/ServicesTable'
import './Services.css'; // Optional CSS file for services styling
import './Dashboard.css';
const Services = () => {
 

  return (
    <div className="services">
      <Sidebar />
      <div className="content">
        <div className="stat-cards">
          <StatCard title="Total Active Users" value="1,234" />
          <StatCard title="Total Inactive Users" value="5353" />
          <StatCard title="Total Consultants" value="1232" />
          <StatCard title="Total Customers" value="1243" />
        </div>
      </div>
    </div>
  );
};

export default Services;
